import React from 'react';
import logo from './logo.svg';
import './App.css';

class App {
  render() {
  return (
    <div className="App">
      <header className="App-header">
        <h2>How's it hangin', homeslice</h2>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}
}

export default App;
